import React, { Component } from 'react';

class BackButton extends Component {
    state = {  }
    render() { 
        return ( 
            <div className="back-button">
            <Button
              style={{
                fontSize: "15px",
                display: "flex",
              }}
              size="large"
              variant="text"
              color="default"
              startIcon={<AddIcon />}
            >
              {"AddGoal"}
            </Button>
          </div>
         );
    }
}

export default BackButton;
